const Contact = () => {
  return (
    <>
      <div>
        <div className='con-box' id='box1'></div>
        <div className='con-box' id='box2'></div>
        <div className='con-box'id='box3'></div>
        <div className='con-box'id='box4'></div>
        <div className='con-box'id='box5'></div>
        <div className='con-box'id='box6'></div>
        <div className='con-box'id='box7'></div>
        <div className='con-box'id='box8'></div>
      </div>
    </>
  );
}

export default Contact;
